import Head from 'next/head'
import styles from '../styles/Home.module.css'
import ScriptTag from 'react-script-tag'
import dynamic from 'next/dynamic'
/*const { JSDOM } = require( "jsdom" );
const { window } = new JSDOM( "" );
const $ = require( "jquery" )( window );*/
require.config({
  paths: {
      jquery: '../js_files/jquery-3.5.1.min.js',
      bootstrap: '../bootstrap/js/bootstrap.min.js'
  },
  shim: {
      'jquery': {
          exports: '$'
      },
      'bootstrap': {
          deps: ['jquery'],
          exports: '$'
      }
    }
});

require(['app', ], function(App) {
  App.initialize();
});

let key = null
export default function Home() {

  /*document.getElementById("POS_tagger-button").addEventListener("click", function() {
      $.ajax({
          url: 'http://127.0.0.1:3000/POS_Tagger',
          type: "POST",
          data: {
              sentence: document.getElementById("POS_tagger-input").value
          },
          success: function(response) {
              console.log(JSON.parse(response));
          }
      })
  })*/

  async function callAPI() {
    if (!key) {
      const getKey = await fetch("api/components/key")
      const newKey = await getKey.text()
      key = newKey
    }
    word1 = document.getElementById("word1").value;
    word2 = document.getElementById("word2").value;
    if (word1.length == 0 || word2.length == 0) {
      document.getElementById("answer").innerText = "Input required";
      return;
    }
    else if (word2.length != word1.length) {
      document.getElementById("answer").innerText = "Words must be the same length";
      return;
    }
    const response = await fetch("api/components/word_transformation/" + key.toString() + "/" + word1 + "/" + word2);
    const butt = await response.text()
    document.getElementById("answer").innerText = butt;
    console.log(butt)
    /*const response = await fetch("api/components/hello/" + key.toString());
    const butt = await response.text()
    console.log(butt)*/
  }

  async function api_request(component, method="GET", data=null) {
    var request = {
      method: method,
    }
    if (data !== null) {
      request.headers= {
        'Content-Type': 'application/json',
      },
      request["body"] = JSON.stringify(data)
    }
    const value = await fetch(`api/components/${component}`, request);
    return value.json();
  }

  async function POS_Tagger() {
    api_request('POS_Tagger', "POST", {
      sentence: document.getElementById('POS_input').value
    })
    .then(response => {
      console.log(response)
    })

  }

  console.log(__dirname)
  return (
    <div>
      <nav className={bootsratp.navbar, bootsratp.navbar-light, bootsratp.navbar-expand-md, bootsratp.navigation-clean}>
          <div className={bootstrap.container}>
            <a className={bootstrap.navbar-brand} href={'#'}>CalebHalter.me</a>
            <button data-toggle="collapse" className="navbar-toggler" data-target="#navcol-1">
              <span class="sr-only">Toggle navigation</span>
              <span class="navbar-toggler-icon"></span>
              </button>
              <div class="collapse navbar-collapse" id="navcol-1">
                  <ul class="navbar-nav ml-auto">
                      <li class="nav-item"><a class="nav-link" href="index.html">Home</a></li>
                      <li class="nav-item"><a class="nav-link active" href="portfolio.html">Portfolio</a></li>
                      <li class="nav-item"><a class="nav-link" href="#">Contact</a></li>
                  </ul>
              </div>
          </div>
      </nav>
      <div class="jumbotron">
          <h1>POS Tagger</h1>
          <p>Enter a sentence and press enter.</p>
          <div class="d-flex justify-content-sm-start align-items-sm-center" style="text-align: center;">
            <input class="d-inline-flex flex-grow-1 align-content-start justify-content-sm-start align-items-sm-center" type="text" id="POS_tagger-input" autofocus="" style="margin-right: 10px;max-width: 80%;"></input>
              <a class="btn btn-primary" role="button" id="POS_tagger-button">Submit</a>
            </div>
      </div>
    </div>
  )
}
